import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import { DemoCode } from "../../code-snippets/post-one";
import BlogMeta from "../../components/BlogMeta";

export const meta = {
  title: "",
  tags: ["serverless", "node.js", "python"],
  layout: "post",
  publishDate: "2017-10-02",
  modifiedDate: false,
  seoDescription: "This post demonstrates syntax-hightlighted code in your post.",
  exclude: false
};
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  meta
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <BlogMeta data={props} mdxType="BlogMeta" />
    <p>{`No need for a title in body. You add the title to the metadata, and it appears here.
Same for tags and publication date.
This starter blog is set up for code highlighting like so:`}</p>
    <DemoCode mdxType="DemoCode" />
    </MDXLayout>;
}

;
